// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@chainlink/contracts/src/v0.8/ChainlinkClient.sol";

contract APIConsumer is ChainlinkClient {
    using Chainlink for Chainlink.Request;

    uint256 public code;
    address public oracle;
    bytes32 public jobId;
    uint256 public fee;

    event DataFullfilled(uint256 code);

    constructor() {

        setChainlinkToken(0xa36085F69e2889c224210F603D836748e7dC0088);

        oracle = 0xc57B33452b4F7BB189bB5AfaE9cc4aBa1f7a4FD8;
        jobId = "d5270d1c311941d0b08bead21fea7747";
        fee = 100000000000000000;
    }

    function requestVolumeData() public returns (bytes32 requestId) 
    {
        Chainlink.Request memory request = buildChainlinkRequest(jobId, address(this), this.fulfill.selector);

        // Set the URL to perform the GET request on
        request.add("get", "https://api.weatherbit.io/v2.0/current?lat=35.7796&lon=-78.6382&key=35b3c240cd63440e83c29506824bb65b");

        request.add("path", "data[0].weather.code");

        // Sends the request
        return sendChainlinkRequestTo(oracle, request, fee);
    }

    function fulfill(bytes32 _requestId, uint256 _code) public recordChainlinkFulfillment(_requestId)
    {
        code = _code;
    }
}
